public class Que04RelationalOperator04 {

	public static void main(String[] args) 
	{
		// TODO Auto-generated method stub
		
		int a = 10;
        int b = 15;
        a++;
        b--;
        int c = b % a;
        System.out.println(c >= b);
		int d = 15 % 10;
		System.out.println(d);
		
	}

}
